import React from 'react';
import ncNewsBackend from '../assets/images/ncNewsBackend.png';
import ncNewsFrontend from '../assets/images/ncNewsFrontend.png';

export const Projects = ({screenWidth}) => {

    const projectsArray = [
        {
            id: "frontendProject",
            linkRef: "https://github.com/HalfElfAlistair/nc-news.git",
            text: 'Frontend Project: NC-News',
            image: {
                src: ncNewsFrontend,
                alt: 'A screenshot from my Northcoders Frontend project.'
            }
        },
        {
            id: "backendProject",
            linkRef: "https://github.com/HalfElfAlistair/nc_backend_project.git",
            text: 'Backend Project: NC-News API',
            image: {
                src: ncNewsBackend,
                alt: 'A screenshot from my Northcoders Backend project.'
            }
        }
    ]

    return (
        <section id="projects">
            <div class="content">
                <h2>My Projects</h2>
                <p>Please feel free to check out <a href="https://github.com/HalfElfAlistair" target="_blank" rel="noopener">my GitHub account</a> where you'll find various repositories, both complete and some works in progress. They'll give you a better idea of where I'm at and how far I've come. Below you'll see a small selection from those repos, which link to their respective location.</p>
                <div class="container">
                    {projectsArray.map(projectData => {
                        const { id, linkRef, text, image } = projectData;
                        return (
                            <div class="project-box" id={id}>
                                <a href={linkRef} target="_blank" rel="noopener" class="project-tile">
                                    <p>{text}</p>
                                    <img src={image.src} alt={image.alt} target="_blank" rel="noopener"></img>
                                </a>
                            </div>
                        )
                    })}
                </div>
            </div>
        </section>
    )
}
